import React, { Component } from "react";
import boe from "../images/boe.jpg";
import micro from "../images/micro.jpg";
import nin from "../images/nin.jpg";
import yam from "../images/yam.jpg";

import Carousel from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";
class Experience extends Component {
  render() {
    return (
      <div className="experience">
        <h2>Experience</h2>
        <p>
          Our team has experience working at Microsoft, Yammer, Nintendo, Boeing
          and many startups.
        </p>
        <Carousel slidesPerPage={4} slidesPerScroll={2} clickToChange arrows>
          <img src={boe} width="50%" height="auto" />
          <img src={micro} width="50%" height="auto" />
          <img src={micro} width="50%" height="auto" />
          <img src={micro} width="50%" height="auto" />
          <img src={nin} width="50%" height="auto" />
        </Carousel>
      </div>
    );
  }
}

export default Experience;
